INSERT INTO `moder_news` (`id`, `title`, `text`, `text_full`, `date`, `autor`) VALUES
(1, 'Добро пожаловать!', '<p>Нашему проекту нужны люди, которые будут следить за серверами и, что не менее важно, за игроками!<br /><br /> Для вашего удобства, был сделан портал для модераторов. Здесь вы сможете отчитаться за проделанную работу, проголосовать за какое-либо нововведение, а также своевременно связываться с администрацией проекта.<br /> Мы будем улучшать и дорабатывать модерпортал. Все новости будут публиковаться здесь и в боковом меню.<br /><br /> Спасибо за внимание.</p>', '<p>Нашему проекту нужны люди, которые будут следить за серверами и, что не менее важно, за игроками!<br /><br />Для вашего удобства, был сделан портал для модераторов. Здесь вы сможете отчитаться за проделанную работу, проголосовать за какое-либо нововведение, а также своевременно связываться с администрацией проекта.<br />Мы будем улучшать и дорабатывать модерпортал. Все новости будут публиковаться здесь и в боковом меню.<br /><br />Спасибо за внимание.</p>', '1521290510', 'forl1nk');
