INSERT INTO `moder_system` (`id`, `param`, `value`) VALUES
(1, 'com1', '<p><strong>/p kick [ник] [причина]-кикнуть игрока, в причине указываем номер правила.</strong></p>\n<p><strong>/p [№ Правила] [ник]</strong>&nbsp;&mdash; Наказание игрока по правилам<br /><strong>/fly</strong>&nbsp;&mdash; Режим полета<br /><strong>/god</strong>&nbsp;&mdash; Режим Бога (бессмертие)<br /><strong>/chat local</strong>&nbsp;&mdash; включить/выключить локальный чат (обязательно чтобы был включен)<br /><strong>/socialspy</strong>&nbsp;&mdash; Позволяет читать личные сообщения игроков<br /><strong>/tp [ник]</strong>&nbsp;&mdash; Телепортация к игроку<br /><strong>//wand</strong>&nbsp;&mdash; Выдать предмет для выделения региона<br /><strong>/we cui</strong>&nbsp;&mdash; Выделяет сетку привата региона<br /><strong>/back</strong>&nbsp;&mdash; Вернуться на место смерти<br /><strong>/whois [игрок]</strong> &mdash; Посмотреть полную информацию о игроке. (Только если онайлн)<br /><strong>/deltree</strong>&nbsp;&mdash; Включить инструмент для удаление недорубов (В руке должна быть палочка, листок и т.п.)&nbsp;</p>\n<p><strong>/none</strong>- выключить инструмент для удаления недорубов</p>\n<p><strong>/warp list -c [nik]</strong>-показать список варпов игрока</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\"><em>&nbsp;</em></p>\n<p>- Инвентарь восстанавливается после смерти (исключение, сервера с активным PvP)<br />- Опыт восстанавливается после смерти (исключение, сервера с активным PvP)<br />- При повторении команд, Вас не кикнет с сервера</p>'),
(2, 'com2', '<p><strong>/p [№ Правила] [ник]</strong> &mdash; Наказание игрока по правилам<br /><strong>/fly</strong> &mdash; Режим полета<br /><strong>/god</strong> &mdash; Режим Бога (бессмертие)<br /><strong>/chat local</strong> &mdash; включить/выключить локальный чат (обязательно чтобы был включен)<br /><strong>/socialspy</strong> &mdash; Позволяет читать личные сообщения игроков<br /><strong>/tp [ник]</strong> &mdash; Телепортация к игроку<br /><strong>//wand</strong> &mdash; Выдать предмет для выделения региона<br /><strong>/we cui</strong> &mdash; Выделяет сетку привата региона<br /><strong>/back</strong> &mdash; Вернуться на место смерти<br /><strong>/whois [ник]&nbsp;</strong>&mdash; Посмотреть полную информацию о игроке. (Только если онайлн)</p>\n<p><em><strong>+ дополнительные команды Moder\'a</strong></em></p>\n<p><br /><strong>/s [ник]</strong> - Телепортация игрока к себе<br /><strong>/tphere [ник]</strong> - Телепортация игрока к себе<br /><strong>/deltree</strong> &mdash; Включить инструмент для удаление недорубов (В руке должна быть палочка, листок и т.п.)<br /><strong>/none</strong> - отключает команду /deltree<br /><strong>/rg info</strong> - позволяет вам узнать в каком вы регионе находитесь<br /><strong>/kit start</strong> - стартовый набор новичка 1 раз в день.<br /><strong>/seen</strong> - показывает статус игрока и его ip, если он он/офф-лайн<br /><strong>/openinv [ник]&nbsp;</strong>- открывать инвентарь игрока<br /><strong>/openender [ник]</strong>&nbsp;- открыть ендер сундук игрока<br /><strong>/home clear [ник]&nbsp;</strong>- удалить хом-ловушку<br /><strong>/home list</strong> - Показывает список всех точек дома на сервере<br /><strong>/home [ник]</strong>&nbsp;- Телепортироваться на дом [игрок]<br /><strong>/remove drop (радиус)</strong> - удалить дроп в радиусе<br /><strong>/rg list</strong> - список регионов<br /><strong>/rg list -p [ник]</strong>&nbsp;- список регионов игрока<br /><strong>//drain&nbsp;(радиус)</strong> - удалить лаву или воду в радиусе (не пашет на нефть и заразу и т.д.)<br /><strong>/undo</strong> - отменить //drain<br /><strong>/tppos x y z</strong> - портоваться на определенные координаты<br /><strong>//</strong> &mdash; Супер-кирка (ломает блоки с 1 удара)<br /><strong>/ci</strong> - очистка инвентаря<br /><strong>/prism i (/pr i)</strong> - Правой кнопкой мыши проверять логи блока, чтобы отключить пропишите повторно.<br /><strong>/warp create/pcreate</strong> - создание варпа<br /><strong>/warp delete</strong> - удаление варпа<br /><strong>/rg flag регион entry allow/deny</strong> - поставить флаг на терру, чтобы никто не входил.<br /><strong>/fixwater</strong> &mdash; Выровнять слой воды (максимум 40)<br /><strong>/fixlava</strong> &mdash; Выровнять слой лавы (максимум 40)<br /><strong>/warp list</strong> - Показывает список варпов всех игроков</p>\n<p style=\"text-align: center;\"><em>&nbsp;</em></p>\n<p>- ипользование компаса ПКМ (сквозь стены проход)<br />- можете открывать закрытые сейфы из индастриал крафта<br />- имеется доступ во все приваты (кроме спавна)</p>'),
(3, 'com3', '<p><strong>/p [№ Правила] [ник]</strong> &mdash; Наказание игрока по правилам<br /><strong>/fly</strong> &mdash; Режим полета<br /><strong>/god</strong> &mdash; Режим Бога (бессмертие)<br /><strong>/chat local</strong> &mdash; включить/выключить локальный чат (обязательно чтобы был включен)<br /><strong>/socialspy</strong> &mdash; Позволяет читать личные сообщения игроков<br /><strong>/tp [ник]</strong> &mdash; Телепортация к игроку<br /><strong>//wand</strong> &mdash; Выдать предмет для выделения региона<br /><strong>/we cui</strong> &mdash; Выделяет сетку привата региона<br /><strong>/back</strong> &mdash; Вернуться на место смерти<br /><strong>/whois [ник]&nbsp;</strong>&mdash; Посмотреть полную информацию о игроке. (Только если онайлн)<br /><strong>/s [ник]</strong> - Телепортация игрока к себе<br /><strong>/tphere [ник]</strong> - Телепортация игрока к себе<br /><strong>/deltree</strong> &mdash; Включить инструмент для удаление недорубов (В руке должна быть палочка, листок и т.п.)<br /><strong>/none</strong> - отключает команду /deltree<br /><strong>/rg info</strong> - позволяет вам узнать в каком вы регионе находитесь<br /><strong>/kit start</strong> - стартовый набор новичка 1 раз в день.<br /><strong>/seen</strong> - показывает статус игрока и его ip, если он он/офф-лайн<br /><strong>/openinv [ник]</strong>&nbsp;- открывать инвентарь игрока<br /><strong>/openender [ник]</strong>&nbsp;- открыть ендер сундук игрока<br /><strong>/home clear [ник]&nbsp;</strong>- удалить хом-ловушку<br /><strong>/home list</strong> - Показывает список всех точек дома на сервере<br /><strong>/home [ник]&nbsp;</strong>- Телепортироваться на дом [игрок]<br /><strong>/remove drop (радиус)</strong> - удалить дроп в радиусе<br /><strong>/rg list</strong> - список регионов<br /><strong>/rg list -p [ник]&nbsp;</strong>- список регионов игрока<br /><strong>//drain (радиус)</strong> - удалить лаву или воду в радиусе (не пашет на нефть и заразу и т.д.)<br /><strong>/undo</strong> - отменить //drain, //regen (/redo - отменяет undo)<br /><strong>/tppos x y z</strong> - портоваться на определенные координаты<br /><strong>//</strong> &mdash; Супер-кирка (ломает блоки с 1 удара)<br /><strong>/ci</strong> - очистка инвентаря<br /><strong>/prism i (/pr i)</strong> - Правой кнопкой мыши проверять логи блока, чтобы отключить пропишите повторно.<br /><strong>/warp create/pcreate</strong> - создание варпа<br /><strong>/warp delete</strong> - удаление варпа<br /><strong>/rg flag регион entry allow/deny</strong> - поставить флаг на терру, чтобы никто не входил.<br /><strong>/fixwater</strong> &mdash; Выровнять слой воды (максимум 40)<br /><strong>/fixlava</strong> &mdash; Выровнять слой лавы (максимум 40)<br /><strong>/warp list</strong> - Показывает список варпов всех игроков</p>\n<p><em><strong>+ дополнительные команды GrandModer\'a</strong></em></p>\n<p><strong>/rg removemember [ник]</strong> - удаляет мембера в регионе<br /><strong>/rg removeowner [ник]</strong>&nbsp;- удаляет владельца в регионе<br /><strong>/rg select (название региона)</strong> - выделяет регион<br /><strong>//regen</strong> - реген выделенной области<br /><strong>/rg remove (название региона)</strong> - удаляет регион<br /><strong>/butcher (радиус)</strong> - удаляет мобов вокруг в радиусе<br /><strong>/list moder</strong> - позволяет увидеть модератора в сети<br /><strong>/list newmoder</strong>&nbsp;- позволяет увидеть ньмодератора в сети<br /><strong>/vanish</strong> &mdash; Режим невидимости<br /><strong>/unpanish [ник] (/unp [ник])</strong> - Позволяет снять мут/бан с игрока<br /><strong>/superpickaxe area (радиус от 1 до 5)</strong> - Переключить суперкирку в режим удаления зоны однотипных блоков<br /><strong>/sun</strong> - Включить ясную погуду на сервере<br /><strong>/rain</strong> - включить дождь на сервере<br /><strong>/day /night</strong> - Включить день/ночь на сервере</p>\n<p>&nbsp;</p>');
