('VIP_costDisc', NULL, NULL),
('Deluxe_percent', '50', NULL),
('groupinfo_VIP', '<center><b>Статус активного игрока, группа имеет малый набор возможностей.</b></center><br>Купив <b>VIP</b> статус ты имеешь возможность заходить на переполненный сервер, сохранять свою броню в случае случайной смерти, а так же вернуться на место смерти всего одной командой! Ты можешь использовать дополнительные регионы и флаги приватных территорий, получать сет железной амуниции и инструментов совершенно бесплатно! <br>И это еще не всё! Более подробно в разделе <a href=\"/donate\">Донат-услуг\r\n</a>.', NULL),
('groupinfo_Premium', '<center><b>Статус продвинутого игрока, группа имеет средний набор возможностей.</b></center> <br>Купив <b>Premium</b> статус ты имеешь все возможности <b>VIP</b>, а так же множество других!<br> Ты можешь получать алмазную амуницию и инструменты, набор пакета ценных ресурсов совершенно бесплатно. <br>Имеешь возможность ставить большинство флагов на приватные территории и зарегистрировать их гораздо больше! <br>У тебя есть возможность использовать множество команд расширяющих игровой процесс, возможность создавать точки телепортации и многое другое! <br>Ты можешь включать персонально для себя на сервере день, когда у всех глубокая ночь. <br>А ещё ты можешь устанавливать персональный префикс!  <br>Это малый набор описанных возможностей! Более подробно в разделе <a href=\"/donate\">Donate</a>.', NULL),
('groupinfo_Deluxe', '<center>Статус эксклюзивного игрока, группа имеет <font color=\"purple\"><b>Эксклюзивный</b></font> набор возможностей.</center><br>Купив <font color=\"purple\"><b>Deluxe</b></font> статус ты получаешь совершенно все возможности предыдущих групп, а так же возможность включить бессмертие на своем регионе и своему персонажу!<br> Можешь создавать регионы, которые будут тебя лечить и восстанавливать сытость. <br>У тебя есть возможность приватить целых 5 огромных регионов по 600 тысяч блоков!<br> Имеешь возможность открыть сундук эндера и верстак находясь вне дома. <br>Скидка <b>25%</b> на все товары в нашем <a href=\"/store\">OnLine магазине</a>. <br>Можешь телепортироваться по координатам и восстанавливать сломанные инструменты введя всего одну команду!<br>Главной особенностью статуса является пакет ресурсов Deluxe, который ты можешь получать раз в 32 дня, он содержит все вещи, которые моментально поднимут тебя в богатейшую элиту игрового сервера!<br>Думаешь это все? НЕТ! Это малый список описанных возможностей, а подробнее о элитном статусе <font color=\"purple\"><b>Deluxe</b></font> ты сможешь прочитать в разделе <a href=\"/donate\">Donate</a>.', NULL),
